Here, we define the data that will actually be stored on-chain when calling extrinsics . Since the offchain-worker can't perform I/O outside of the wasm context, we store our requests as queues, to be processed on a periodic basis, consumed, and ultimately performed by the native runtime. This is where we use the ConnectionQueue, DataQueue, and DhtQueue command types from above. // This pallet's storage items.
