This section, perhaps the most critical section of any given pallet, is where you can define functions that are exposed via JSON-RPC to client libraries and, by proxy, your users. In practice, the bulk of what these functions do is to modify the DataQueue, DhtQueue, and ConnectionQueue storage objects by pushing signed command requests to their respective queues. Some default types in the functions are omitted, but we've kept the #[weight] attributes around. The Substrate docs define one unit of weight as "one picosecond of execution time on fixed reference hardware." These are essentially time limits for block creation, and can be (indirectly) mapped to transaction fees analogous to something like "gas fees." Read more about weights if you're curious. // The pallet's dispatchable functions.
decl_module! { /// The module declaration. pub struct Module<T: Trait> for enum Call where origin: T::Origin { // Called at the beginning of every block before any extrinsics. Clears // `ConnectionQueue` and `DhtQueue` values every block, and clears // `DataQueue` every other block, since they should have been processed // Returns a weight of 0 fn on_initialize(block_number: T::BlockNumber) -> Weight // Called at the beginning of every block to create extrinsics. // - `connection_housekeeping` and `handle_dht_requests` called every block // - `handle_data_requests` is called on every other block // - `print_metadata` is called every 5 blocks // blocks to alleviate some bandwidth and storage congestion fn offchain_worker(block_number: T::BlockNumber) /// Mark a `Multiaddr` as a desired connection target. #[weight = 100_000] pub fn ipfs_connect(origin, addr: Vec<u8>) /// Queues a `Multiaddr` to be disconnected #[weight = 500_000] pub fn ipfs_disconnect(origin, addr: Vec<u8>) /// Add arbitrary bytes to the IPFS repository. #[weight = 200_000] pub fn ipfs_add_bytes(origin, data: Vec<u8>) /// Find and output IPFS data pointed to by the given `Cid` #[weight = 100_000] pub fn ipfs_cat_bytes(origin, cid: Vec<u8>) /// Remove bytes from IPFS by `Cid` #[weight = 300_000] pub fn ipfs_remove_block(origin, cid: Vec<u8>) /// Pins a given `Cid` non-recursively. #[weight = 100_000] pub fn ipfs_insert_pin(origin, cid: Vec<u8>) /// Unpins a given `Cid` non-recursively. #[weight = 100_000] pub fn ipfs_remove_pin(origin, cid: Vec<u8>) /// Find addresses associated with the given `PeerId`. #[weight = 100_000] pub fn ipfs_dht_find_peer(origin, peer_id: Vec<u8>) /// Find the list of `PeerId`s known to be hosting the given `Cid`. #[weight = 100_000] pub fn ipfs_dht_find_providers(origin, cid: Vec<u8>) }
}

